import React, { Component } from 'react'

export class Development extends Component {
    render() {
        return (
            <React.Fragment>
                <div className="outer_wrapper">
                    
                </div>
                <div className="top_header">
                    OUR TOP-END JAVA DEVELOPMENT SERVICES
                    </div>
                    <div className="java_development_image">
                    </div>
                    <div className="inner_image">
                    </div>
                    <div className="enterprise_header">
                    Enterprise Java Development
                    </div>
                    <div className="enterprise_text">
                    Enterprises face a sea of challenges in a <br/>
                    quest to constantly expand and stay<br/>
                     competitive. Our Java enterprise<br/>
                      development services are specifically aimed<br/> 
                      at boosting the enterprise growth in a well <br/>
                      and sustained manner. Lorem ipsum, or <br/>
                      lipsum as it is sometimes known, is dummy<br/>
                       text used in laying out print, graphic or web<br/>
                        designs.
                    </div>
                    <div className="outer_button">
                    </div>
                    <div className="inner_button">
                    Request A Free Consultation
                    </div>
                <style jsx>{`
                .outer_wrapper{       
                }
                .top_header{
                    position: absolute;
                    width: 780px;
                    height: 42px;
                    left: 273px;
                    top: 1542px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 36px;
                    line-height: 42px;
                    text-align: center;
                    color: #000000;
                }
                .java_development_image{
                    position: absolute;
                    width: 640px;
                    height: 503px;
                    left: 0px;
                    top: 1691px;
                    background: url(java_developmet.png);
                    border:2px solid black;
                }
                .inner_image{
                    position: absolute;
                    width: 619px;
                    height: 527px;
                    left: 20px;
                    top: 1703px;
                    border:2px solid grey;
                }
                .enterprise_header{
                    position: absolute;
                    width: 302px;
                    height: 98px;
                    left: 650px;
                    top: 1721px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 500;
                    font-size: 42px;
                    line-height: 49px;
                    color: #222222;
                }
                .enterprise_text{
                    position: absolute;
                    width: 476px;
                    height: 259px;
                    left: 650px;
                    top: 1837px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: 300;
                    font-size: 24px;
                    line-height: 28px;
                    color: #444444;
                    border:1px solid black
                }
                .outer_button{
                    position: absolute;
                    width: 284px;
                    height: 50px;
                    left: 650px;
                    top: 2140px;
                    background: #FFFFFF;
                    border: 2px solid #184A88;
                    box-sizing: border-box;
                    border-radius: 4px;
                }
                .inner_button{
                    position: absolute;
                    width: 202px;
                    height: 19px;
                    left: 688px;
                    top: 2155px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 16px;
                    line-height: 19px;
                    display: flex;
                    align-items: center;
                    text-align: center;
                    color: #184A88;
                }
                
                `}</style>
            </React.Fragment>
        )
    }
}

export default Development
